import Post from './Post/Post';

const MyPosts = () => {
    return (
        <div className={classes.posts_block}>
            My Posts
            <div>
                <div>
                    <textarea></textarea>
                </div>
                <button>Add post</button>
            </div>
            <div className={classes.posts}>
                <Post message='How are you?' likes='15' />
                <Post message="I`m fine" likes='20' />
            </div>
        </div>
    )
}

export default MyPosts;
